sfactory.setNamespaceAware(true);
try {
    sfactory.setFeature("http://apache.org/xml/features/disallow-doctype-decl", true);
} catch (Exception e) {
    LOG.warn("SAXParser doesn't support the feature {} with value {}, due to {}.", new Object[]{"http://apache.org/xml/features/disallow-doctype-decl", "true", e});
}

